DROP PROCEDURE IF EXISTS `add_detalle_temp`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `add_detalle_temp` (IN `codigo` INT, IN `cantidad` INT, IN `token_user` VARCHAR(50), IN `descuento` DOUBLE(10,2))   BEGIN 
    
    	DECLARE monto_actual decimal(10,2);
        
        	 SELECT monto INTO monto_actual FROM pagos WHERE idpago = codigo;
        
        	INSERT INTO detalle_temp(token_user, idpago, cantidad_dia, monto, descuento) VALUES (token_user, codigo, cantidad, monto_actual, descuento);
        
        	SELECT tmp.correlativo, tmp.idpago, p.descripcion, tmp.cantidad_dia, tmp.monto, tmp.descuento FROM detalle_temp tmp
        	INNER JOIN pagos p 
       	 	ON tmp.idpago = p.idpago
        	WHERE tmp.token_user = token_user;
        
    END$$

