DROP PROCEDURE IF EXISTS `Generar_Codigo`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `Generar_Codigo` (OUT `nroreferencia` VARCHAR(9))   BEGIN
    DECLARE contador INT;
    BEGIN
        SET contador= (SELECT COUNT(*)+1 FROM mensualidad); 
        IF(contador<10)THEN
            SET nroreferencia= CONCAT('JRG-0000',contador);
            ELSE IF(contador<100) THEN
                SET nroreferencia= CONCAT('JRG-000',contador);
                ELSE IF(contador<1000)THEN
                    SET nroreferencia= CONCAT('JRG-00',contador);
                END IF;
            END IF;
        END IF; 
    END;
END$$

DROP PROCEDURE IF EXISTS `procesar_pago`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `procesar_pago` (IN `cod_usuario` INT, IN `idatletas` INT, IN `token` VARCHAR(50), IN `nombre_usuario` VARCHAR(100), IN `noserie` VARCHAR(250))   BEGIN 
    	DECLARE factura INT;
        
        DECLARE registros INT;
        DECLARE total DECIMAL(10,2);
        DECLARE tmp_cod_pago BIGINT;
        DECLARE tmp_dias_pago int;
        DECLARE tmp_cant_descuento int;
        DECLARE a INT;
        SET a = 1;
        
        CREATE TEMPORARY TABLE tbl_tmp_tokenuser (
            id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
            cod_pago int,
            dias_pago int,
            cant_descuento int);
            
            SET registros = (SELECT COUNT(*) FROM detalle_temp WHERE token_user = token);
            
            IF registros > 0 THEN
				INSERT INTO tbl_tmp_tokenuser(cod_pago,dias_pago,cant_descuento) SELECT idpago,cantidad_dia,descuento FROM detalle_temp WHERE token_user = token;
				
            	INSERT INTO factura(usuario,idatletas,nombre_usuario,noserie) VALUES (cod_usuario, idatletas,nombre_usuario,noserie);
                SET factura = LAST_INSERT_ID();
                
                INSERT INTO detalle_factura(nofactura,idpago,cantidad_dia,monto,descuento) SELECT (factura) as nofactura, idpago,cantidad_dia,monto,descuento FROM detalle_temp
                WHERE token_user = token;
                
                	WHILE a <= registros DO
                    	SELECT cod_pago, dias_pago,cant_descuento INTO tmp_cod_pago, tmp_dias_pago,tmp_cant_descuento FROM tbl_tmp_tokenuser WHERE id = a;
                                                                                                                   
                        SET a=a+1;
                    
                END WHILE;
                    
						SET total = (SELECT SUM((cantidad_dia * monto)-descuento) FROM detalle_temp WHERE token_user = token);
						UPDATE factura SET totalpago = total WHERE nofactura = factura;
						DELETE FROM detalle_temp WHERE token_user = token;
						TRUNCATE TABLE tbl_tmp_tokenuser;
						SELECT * FROM factura WHERE nofactura = factura;
                    
					ELSE 
					SELECT 0;
		END IF;
	END$$

