--
DROP TRIGGER IF EXISTS `Generar_codigo`;
DELIMITER $$
CREATE TRIGGER `Generar_codigo` BEFORE INSERT ON `mensualidad` FOR EACH ROW begin
	declare siguiente_codigo int;
    set siguiente_codigo = (Select ifnull(max(idmensualidad),0)+ 1 from mensualidad);
    set new.nroreferencia = concat('JRG-', LPAD( siguiente_codigo, 5, '0'));
END
$$
DELIMITER ;

