--
-- Disparadores `usuario`
--
DROP TRIGGER IF EXISTS `supervisor`;
DELIMITER $$
CREATE TRIGGER `supervisor` AFTER INSERT ON `usuario` FOR EACH ROW BEGIN
    IF NEW.rol != 3 THEN 
    
      BEGIN
          INSERT INTO supervisor (idusuario,nombre, clave, rol, estatus)
          VALUES (NEW.idusuario,NEW.nombre, NEW.clave, NEW.rol, NEW.estatus);
      END; 
   END IF;

 END
$$
DELIMITER ;

