--
-- Estructura para la vista `vista_detalle_facturado`
--
DROP TABLE IF EXISTS `vista_detalle_facturado`;

DROP VIEW IF EXISTS `vista_detalle_facturado`;
CREATE VIEW `vista_detalle_facturado`  AS SELECT `df`.`nofactura` AS `nofactura`, `p`.`codpago` AS `cod`, `f`.`nombre_usuario` AS `usuario`, `a`.`nombres` AS `cliente`, date_format(`f`.`fecha`,'%d-%m-%Y') AS `fecha`, `p`.`descripcion` AS `descripcion`, `p`.`iva` AS `iva`, `df`.`cantidad_dia` AS `cantidad`, `df`.`monto` AS `monto`, `df`.`cantidad_dia`* `df`.`monto` AS `subTotal`, `df`.`cantidad_dia`* `df`.`monto` * `p`.`iva` * 0.01 AS `totalIva`, `df`.`descuento` AS `descuento`, `df`.`cantidad_dia`* `df`.`monto` - `df`.`descuento` AS `total` FROM (((`pagos` `p` join `detalle_factura` `df` on(`p`.`idpago` = `df`.`idpago`)) join `factura` `f` on(`f`.`nofactura` = `df`.`nofactura`)) join `atletas` `a` on(`f`.`idatletas` = `a`.`idatletas`)) WHERE `p`.`estatus` = 1 AND year(`p`.`fecha_pago`) = year(current_timestamp()) ORDER BY `df`.`nofactura` ASC  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vista_facturacion`
--
DROP TABLE IF EXISTS `vista_facturacion`;

DROP VIEW IF EXISTS `vista_facturacion`;
CREATE VIEW `vista_facturacion`  AS SELECT `f`.`nofactura` AS `factura`, date_format(`f`.`fecha`,'%d-%m-%Y') AS `fecha`, `a`.`nombres` AS `cliente`, `a`.`telefono` AS `telefono`, `f`.`nombre_usuario` AS `cobrador`, `f`.`totalPago`+ `df`.`descuento` AS `importe`, `df`.`descuento` AS `descuento`, `f`.`totalPago`+ `df`.`descuento` - `df`.`descuento` AS `total` FROM ((`factura` `f` join `detalle_factura` `df` on(`f`.`nofactura` = `df`.`nofactura`)) join `atletas` `a` on(`f`.`idatletas` = `a`.`idatletas`)) GROUP BY `factura`  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vista_listarfacturacion_por_meses`
--
DROP TABLE IF EXISTS `vista_listarfacturacion_por_meses`;

DROP VIEW IF EXISTS `vista_listarfacturacion_por_meses`;
CREATE VIEW `vista_listarfacturacion_por_meses`  AS SELECT `mes`(`factura`.`fecha`,'es_ES') AS `mes`, year(`factura`.`fecha`) AS `año`, sum(`factura`.`totalPago`) AS `venta` FROM `factura` WHERE `factura`.`estatus` = 1 AND year(`factura`.`fecha`) = year(current_timestamp()) GROUP BY `mes`(`factura`.`fecha`,'es_ES')  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vista_listar_atletas`
--
DROP TABLE IF EXISTS `vista_listar_atletas`;

DROP VIEW IF EXISTS `vista_listar_atletas`;
CREATE VIEW `vista_listar_atletas`  AS SELECT `atletas`.`cedula` AS `cedula`, `atletas`.`nombres` AS `nombres`, `atletas`.`sexo` AS `sexo`, `atletas`.`edad` AS `edad`, `atletas`.`correo` AS `correo`, `atletas`.`telefono` AS `telefono`, `atletas`.`fecha_registro` AS `fecha_registro`, `atletas`.`asistencia` AS `asistencia`, `atletas`.`observaciones` AS `observaciones`, `atletas`.`direccion` AS `direccion`, `atletas`.`foto` AS `foto` FROM `atletas` WHERE `atletas`.`estatus` = 11  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vista_listar_facturas`
--
DROP TABLE IF EXISTS `vista_listar_facturas`;

DROP VIEW IF EXISTS `vista_listar_facturas`;
CREATE VIEW `vista_listar_facturas`  AS SELECT `a`.`idatletas` AS `cod_atleta`, `f`.`nofactura` AS `nofactura`, `a`.`cedula` AS `cedula`, `a`.`nombres` AS `cliente`, `a`.`telefono` AS `telefono`, `a`.`direccion` AS `direccion`, date_format(`f`.`fecha`,'%d/%m/%Y') AS `fecha_factura`, `f`.`totalPago` AS `totalFactura` FROM (`atletas` `a` join `factura` `f` on(`a`.`idatletas` = `f`.`idatletas`)) WHERE year(`f`.`fecha`) = year(current_timestamp()) AND `f`.`estatus` = 1 GROUP BY `f`.`nofactura` ORDER BY `f`.`nofactura` ASC  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vista_listar_mensualidad`
--
DROP TABLE IF EXISTS `vista_listar_mensualidad`;

DROP VIEW IF EXISTS `vista_listar_mensualidad`;
CREATE VIEW `vista_listar_mensualidad`  AS SELECT `mensualidad`.`idmensualidad` AS `idmensualidad`, `mensualidad`.`nroreferencia` AS `nroreferencia`, `mensualidad`.`fecha` AS `fecha`, `mensualidad`.`cedula` AS `cedula`, `mensualidad`.`nombres` AS `nombres`, `mensualidad`.`fecha_inscripcion` AS `fecha_inscripcion`, `mensualidad`.`fecha_final` AS `fecha_final`, `mensualidad`.`monto_inscripcion` AS `monto_inscripcion`, `mensualidad`.`monto_mensualidad` AS `monto_mensualidad`, `mensualidad`.`monto_abono` AS `monto_abono`, `mensualidad`.`monto_debe` AS `monto_debe`, `mensualidad`.`forma_depago` AS `forma_depago`, `mensualidad`.`nombre_entrenador` AS `nombre_entrenador`, `mensualidad`.`monto_entrenador` AS `monto_entrenador`, `mensualidad`.`fecha_inicio` AS `fecha_inicio`, `mensualidad`.`fecha_finaliza` AS `fecha_finaliza`, `mensualidad`.`entrenamientos` AS `entrenamientos`, `mensualidad`.`turno` AS `turno`, `mensualidad`.`hora_entrada` AS `hora_entrada`, `mensualidad`.`hora_salida` AS `hora_salida`, `mensualidad`.`rutaFoto` AS `rutaFoto`, `mensualidad`.`foto` AS `foto` FROM `mensualidad` WHERE year(`mensualidad`.`fecha`) = year(current_timestamp())  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vista_listar_rutinas`
--
DROP TABLE IF EXISTS `vista_listar_rutinas`;

DROP VIEW IF EXISTS `vista_listar_rutinas`;
CREATE VIEW `vista_listar_rutinas`  AS SELECT `rutinas`.`idrutina` AS `idrutina`, `rutinas`.`idatletas` AS `idatletas`, `rutinas`.`cedula` AS `cedula`, `rutinas`.`nombres` AS `nombres`, `rutinas`.`entrenador` AS `entrenador`, `rutinas`.`dia` AS `dia`, `rutinas`.`fecha` AS `fecha`, `rutinas`.`fecha_rutina` AS `fecha_rutina`, `rutinas`.`rutinas` AS `rutinas`, `rutinas`.`modalidad` AS `modalidad`, `rutinas`.`ejercicio` AS `ejercicio`, `rutinas`.`serie` AS `serie`, `rutinas`.`repeticiones` AS `repeticiones`, `rutinas`.`descanso` AS `descanso` FROM `rutinas` WHERE year(`rutinas`.`fecha`) = year(current_timestamp()) ORDER BY `rutinas`.`idatletas` ASC  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vista_max_numero_serie`
--
DROP TABLE IF EXISTS `vista_max_numero_serie`;

DROP VIEW IF EXISTS `vista_max_numero_serie`;
CREATE VIEW `vista_max_numero_serie`  AS SELECT `numero_serie_factura`.`serie_inicio` AS `inicio`, `numero_serie_factura`.`serie_final` AS `final` FROM `numero_serie_factura` WHERE `numero_serie_factura`.`estatus` = 1 AND year(`numero_serie_factura`.`fecha`) = year(now());


