--
-- Estructura para la vista vista_totalfactura_diaria
--
DROP TABLE IF EXISTS vista_totalfactura_diaria;

DROP VIEW IF EXISTS vista_totalfactura_diaria;

CREATE VIEW vista_totalfactura_diaria  AS 
SELECT date_format(fecha,"%d-%m-%Y") AS fecha,mes(fecha,"es_ES") AS mes,sum(totalPago) AS total_factura 
FROM factura 
WHERE year(fecha) = year(now())
AND estatus = 1 
GROUP BY fecha ;
-- --------------------------------------------------------

--
-- Estructura para la vista vista_totalfactura_mensual
--
DROP TABLE IF EXISTS vista_totalfactura_mensual;

DROP VIEW IF EXISTS vista_totalfactura_mensual;

CREATE VIEW vista_totalfactura_mensual  AS 
 SELECT mes(fecha,'es_ES') AS mes,sum(totalPago) AS total_factura 
FROM factura 
WHERE year(fecha) = year(now())
AND estatus = 1 
GROUP BY mes
ORDER BY fecha ;
-- --------------------------------------------------------

--
-- Estructura para la vista vista_total_factura_anual
--
DROP TABLE IF EXISTS vista_total_factura_anual;

DROP VIEW IF EXISTS vista_total_factura_anual;
CREATE VIEW vista_total_factura_anual  AS 
SELECT sum(df.cantidad_dia * df.monto) AS venta,sum(df.descuento) AS descuento,sum(df.cantidad_dia * df.monto) - sum(df.descuento) AS total 
FROM factura f 
JOIN detalle_factura df
ON f.nofactura = df.nofactura
WHERE estatus = 1 
AND year(fecha) = year(now());

